'use strict';describe('infoLog',function(){var infoLog=require('../infoLog');it('logs messages to the console',function(){console.log=jest.fn();infoLog('This is a log message');expect(console.log).toHaveBeenCalledWith('This is a log message');});it('logs messages with multiple arguments to the console',function(){console.log=jest.fn();var data='log';infoLog('This is a',data,'message');expect(console.log).toHaveBeenCalledWith('This is a','log','message');});});